import React, { Component } from 'react';
import './Foods.css';

class Foods extends Component {
  constructor() {
    super();

    this.state = {
      Foods: []
    }
  }

  componentDidMount(){
    fetch('/api/foods')
  }

  render() {
    return(
      <div>
        <h2>Foods</h2>
      </div>
    );
  }
}

export default Foods;
